import './App.css';
import Navbar from './navbar/Navbar';
import Home from './landing-page/Home';
import {BrowserRouter, Routes, Route} from 'react-router-dom';


function App() {
  return (
    <div>
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path='' />
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
